import './App.css';
import { Routes, Route, BrowserRouter as Router } from "react-router-dom";
import Layout from './layout';

function App() {
  return (
    <div className="App">
      <Layout>
      <Routes>
          <Route exact path="/" element={<Home />} />
        </Routes>

      </Layout>

    </div>
  );
}

export default App;
